import { Routes, Route, Navigate } from "react-router-dom";
import Home from "../pages/Home";
import JobsPage from "../pages/JobsPage";
import RecommendationsPage from "../pages/RecommendationsPage";
import AppliedJobsPage from "../pages/AppliedJobsPage";
import ProfilePage from "../pages/ProfilePage";
import EmployerSignup from "../pages/EmployerSignup";
import EmployerLogin from "../pages/EmployerLogin";
import JobSeekerSignup from "../pages/JobSeekerSignup";
import JobSeekerLogin from "../pages/JobSeekerLogin";
import MyPostedJobs from "../pages/recruiters/MyPostedJobs";
import PostJob from "../pages/recruiters/PostJob";
import ViewApplicants from "../pages/recruiters/ViewApplicants";
import RecruiterProfilePage from "../pages/RecruiterProfilePage";
import Dashboard from "../components/Dashboard";
import DashboardRecruiter from "../components/DashboardRecruiter";
import DashboardGuest from "../components/DashboardGuest";
import { useAuth } from "../context/AuthContext";

const AppRoutes = () => {
  const { user } = useAuth();

  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/jobs" element={<JobsPage />} />
      <Route path="/recommendations" element={<RecommendationsPage />} />
      <Route path="/profile" element={user?.role === "job_seeker" ? <ProfilePage /> : <Navigate to="/" />} />
      <Route path="/applied-jobs" element={user?.role === "job_seeker" ? <AppliedJobsPage /> : <Navigate to="/" />} />
      <Route path="/employer-signup" element={<EmployerSignup />} />
      <Route path="/employer-login" element={<EmployerLogin />} />
      <Route path="/signup" element={<JobSeekerSignup />} />
      <Route path="/login" element={<JobSeekerLogin />} />
      <Route path="/my-posted-jobs" element={user?.role === "recruiter" ? <MyPostedJobs /> : <Navigate to="/" />} />
      <Route path="/post-job" element={user?.role === "recruiter" ? <PostJob /> : <Navigate to="/" />} />
      <Route path="/view-applicants" element={user?.role === "recruiter" ? <ViewApplicants /> : <Navigate to="/" />} />
      <Route path="/recruiter-profile" element={user?.role === "recruiter" ? <RecruiterProfilePage /> : <Navigate to="/" />} />
      
      {/* ✅ Route Users to Correct Dashboards */}
      <Route path="/dashboard" element={
        user?.role === "recruiter" ? <DashboardRecruiter /> :
        user?.role === "job_seeker" ? <Dashboard /> :
        <DashboardGuest />
      } />
    </Routes>
  );
};

export default AppRoutes;
